  root: {
    flexGrow: 1,
    marginTop:'10rem',
    marginBottom:'10rem'
  },
  paper: {
    height: 300,
    width: 340,
    margin: 'auto'
  },
  control: {
    padding: theme.spacing(2),
    textAlign: 'center',
    marginTop:'3rem',
    marginBottom:"3rem"

  },
}));

const  Project = () =>{
  const classes = useStyles();


  return (
    <Grid 
    container 
    direction="row"
    justify="center"
    alignItems="flex-center"
    className={classes.root} 
    spacing={2}>

      <Grid item xs>
      <Grid container justify="flex-start" spacing={5}>
        <Box className={classes.control} >
         <Title title='Projects' />
         </Box>
      </Grid>

        <Grid container justify="center" spacing={5}>


            <Grid key={value} item>
              <Paper className={classes.paper} >
                  <ProjectCard title="Expense Tracker"/>
              </Paper>
            </Grid>

        </Grid>
      </Grid>

    </Grid>
  );
}
export default React.memo(Project)
